import React, { useEffect, useState } from "react";
import RoleItem from "../../components/RoleItem/RoleItem";
import { URL_GOOGLE_SHEETS } from "../../constants";
import SheetApi from "g-sheets-api";

const RolezandoList = () => {
  const [list, setList] = useState({});
  const [hasError, setHasError] = useState(false);

  useEffect(() => {
    const data = fetch(URL_GOOGLE_SHEETS).then((res) => res.text());

    data.then((result) => {
      const resp = result
        .replace("google.visualization.Query.setResponse(", "")
        .replace("/*O_o*/", "")
        .replace("\n", "")
        .replace(");", "");

      const response = JSON.parse(resp);

      const headers = response.table.cols.map((item) => item.label);

      const data = [];

      headers.forEach((item, i) => {
        console.log(response.table.row, i);

        response.table.rows.forEach((item, index) => {
          const value = item.c[index].v;

          // console.log(item.c[i]);

          data.push({
            createdBy: value,
            createdAt: value,
            name: value,
            city: value,
            category: value,
            price: value,
            hasPlaceToChildren: value,
            points: value,
            comment: value,
          });
        });
      });

      setList({ data, headers });
    });
  }, []);

  // console.log(list);

  return (
    <>
      {JSON.stringify(list)}
      {/* {list.map((item) => (
        <RoleItem data={item} />
      ))} */}
    </>
  );
};

export default RolezandoList;
